const TextView = ({text}) => {
    return <div>{text}</div>
}


const OptimizeTest = () => {

    const [count, setCount] = useState(1);
    const [text, setText] = useState("");

    return (
        <div style={{padding:50}}>
            <div>
                <h2>count</h2>
                <button onClick={()=>setCount(count+1)}>+</button>
            </div>
            <div>
                <h2>text</h2>
                <button value={text} onChange={(e)=>setText(e.target.value)}>+</button>
            </div>
        </div>
    );
};

export default OptimizeTest;
